(window.webpackJsonp=window.webpackJsonp||[]).push([[1329],{1685:function(n,h,i){"use strict";i.r(h);var t=i(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-2167-cuu-đe-tuc-danh"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2167-cuu-đe-tuc-danh"}},[n._v("#")]),n._v(" Chương 2167: Cửu Đế tục danh")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("Trương Huyền đầu óc “Ong ong!” Vang lên, nghĩ đến cái gì, nói: “Hơn bốn mươi năm trước chết rồi? Cái này sao có thể! Có thể hay không Linh Thần là truyền thừa xưng hào, ta muốn tìm chính là... Tân nhiệm Linh Thần!”"),i("br"),i("br"),n._v("Lạc Nhược Hi cùng mình hơn một tháng trước mới tách ra, làm sao có thể hơn bốn mươi năm trước liền chết?"),i("br"),i("br"),n._v("Cũng không thể ở chung chính là quỷ hồn đi..."),i("br"),i("br"),n._v("Đoán không sai, “Linh Thần” hẳn là chỉ là cái danh hào, đời trước vẫn lạc, đời tiếp theo kế vị đồng dạng sử dụng."),i("br"),i("br"),n._v("Nguyên nhân chính là như vậy, Ngột Thần là Thần Dung Hoàng, Lưu Dương cũng là Thần Dung Hoàng."),i("br"),i("br"),n._v("“Cái này... Còn có thể kế nhiệm?” Phù Giang Thần sửng sốt một chút: “Không nên ah, nếu quả thật có loại tình huống này, toàn bộ Thần giới, khẳng định đã sớm biết, không có khả năng không có tin tức...”"),i("br"),i("br"),n._v("“Toàn bộ Thần giới đều có tin tức?” Trương Huyền càng thêm mê hoặc, nghi vấn hỏi: “Linh Thần địa vị rất cao?”"),i("br"),i("br"),n._v("Coi như phong hào Thần Vương thay đổi, cũng không có khả năng khoa trương, làm cho cả Thần giới cũng biết đi."),i("br"),i("br"),n._v("“Cửu Thiên Cửu Đế một trong, ngươi nói địa vị có cao hay không?” Phù Giang Thần cười khổ."),i("br"),i("br"),n._v("Trương Huyền cứng đờ: “Ngươi nói Lạc Nhược Hi... Linh Thần là Cửu Đế một trong?”"),i("br"),i("br"),n._v("Đã sớm suy đoán bạn gái thân phận khả năng không đơn giản, địa vị cũng rất cao, làm sao đều không có nghĩ đến, là Cửu Thiên Cửu Đế một trong!"),i("br"),i("br"),n._v("Thần giới đỉnh phong nhất siêu cấp cường giả..."),i("br"),i("br"),n._v("Đây cũng quá rung động đi!"),i("br"),i("br"),n._v("Đầu choáng váng, Trương Huyền cảm giác có chút mộng ảo, nếu như là thật, cũng liền rõ ràng vì sao đối phương sống chết không nói ra thân phận của mình, vừa mới bắt đầu cũng là sao không nguyện ý cùng bản thân ở chung được."),i("br"),i("br"),n._v("Loại thân phận này, cho dù là người kế nhiệm, cũng thực sự quá cao, căn bản không phải một cái hạ giới phàm nhân, có thể ghép đôi bên trên."),i("br"),i("br"),n._v("“Vâng!” Phù Giang Thần gật đầu."),i("br"),i("br"),n._v("“Không biết... Là Cửu Thiên bên trong, cái nào một thiên Đại Đế?”"),i("br"),i("br"),n._v("Trương Huyền nhịn không được hỏi."),i("br"),i("br"),n._v("Cửu Thiên biết, chín vị Đế Quân, nhưng cũng không rõ ràng, không biết Lạc Nhược Hi là một ngày kia chưởng khống giả, hiểu rõ cũng tốt chạy tới tìm kiếm."),i("br"),i("br"),n._v("“Ngươi không biết?” Thấy trước mắt vị này, không muốn giả bộ, là thật không rõ, Phù Giang Thần cười khổ một tiếng, lắc đầu: “Linh Thần đương nhiên là Linh Nguyên thiên chúa tể!”"),i("br"),i("br"),n._v("“Linh Nguyên thiên?” Trương Huyền sửng sốt, nghĩ đến cái gì, thân thể cứng đờ: “Ngươi nói là... Bất Tử thiên? Bất Tử Đế Tôn?”"),i("br"),i("br"),n._v("“Đúng a!”"),i("br"),i("br"),n._v("Phù Giang Thần gật đầu."),i("br"),i("br"),n._v("“Cái này...” Trương Huyền bối rối."),i("br"),i("br"),n._v("Linh Thần là Bất Tử Đế Tôn... Có thể Bất Tử Đế Tôn rõ ràng đã chết! Tại Thượng Thương còn nhìn thấy qua phần mộ của hắn!"),i("br"),i("br"),n._v("“Chẳng lẽ... Bất Tử Đế Tôn sau khi chết, Lạc Nhược Hi kế vị, biến thành mới Linh Thần?”"),i("br"),i("br"),n._v("Chần chờ không bao lâu, tâm niệm khẽ động, nghĩ đến một cái có khả năng nhất đáp án."),i("br"),i("br"),n._v("Nếu nàng là Linh Thần, Bất Tử Đế Tôn cũng thế... Chỉ có loại tình huống này có thể giải thích."),i("br"),n._v("“Ta đây cũng không biết...”"),i("br"),i("br"),n._v("Phù Giang Thần dừng lại một chút, mặt mũi xấu hổ, nói: “Có điều, cũng không tốt nói, đi đến Đế Quân loại này cấp bậc, không phải chúng ta có thể tùy ý đoán... Bởi vì Cửu Thiên từ khi tồn tại, Đế Quân liền chưa hề vẫn lạc qua, lần đầu tiên xuất hiện loại tình huống này, có hay không người kế nhiệm, người kế nhiệm là ai, ai cũng không biết...”"),i("br"),i("br"),n._v("Lại hỏi thăm vài câu, thấy hắn đối Linh Nguyên thiên vị này “Linh Thần” biết cũng không nhiều, Trương Huyền không hỏi thêm nữa, suy nghĩ một chút nói: “Không biết, Cửu Thiên mỗi bên là cái nào chín vị Đế Quân?”"),i("br"),i("br"),n._v("Cửu Thiên Cửu Đế kiến thức, thư tịch bên trên không có ghi chép, chính mình hiểu rõ sự tình, là vừa tới Thần giới về sau, theo Mặc Vân trong miệng lão sư biết sơ sơ, nếu trước mắt vị này, đối Thần giới tìm hiểu rất nhiều, vừa vặn cẩn thận hỏi thăm thoáng cái."),i("br"),i("br"),n._v("“Đây không tính là bí mật gì, hơi tìm hiểu, đều có thể biết!”"),i("br"),i("br"),n._v("Thấy hắn hỏi thăm cũng không phải là cái gì không thể nói cơ mật, Phù Giang Thần cũng không giấu diếm, nói: “Cửu Thiên ngươi hẳn phải biết, ta cũng không muốn nói nhiều, còn Cửu Đế. Vân Ly Đại Đế, tọa trấn phía đông Vân Ly thiên, chính là Chân Long huyết mạch, thiên hạ vô song. Phù Mãnh Đế Quân vũ dũng vô địch, chưởng khống phương tây Canh Kim thiên.”"),i("br"),i("br"),n._v("“Linh Nguyên thiên, cũng gọi Bất Tử thiên, nằm ở Thần giới chính nam phương, chưởng khống giả vì Bất Tử Đế Quân, cũng gọi Linh Nguyên chi thần, tên gọi tắt Linh Thần!”"),i("br"),i("br"),n._v("“Cùng phía nam đối lập phương bắc, là Huyền Minh thiên, cũng gọi Huyền Minh hải, là một mảnh to lớn đại dương, Thần Vương cường giả tiến vào bên trong, đều sẽ rơi vào trong đó, mãi mãi cũng tìm không thấy giới hạn... Chưởng khống giả vì Huyền Minh Đại Đế!”"),i("br"),i("br"),n._v("“Liệt Dương thiên nằm ở Thần giới phía đông nam, Chước Dương Đại Đế quản lý trên bầu trời mặt trời, chỗ đến, tựa như liệt diễm thiêu đốt, không người có thể kháng.”"),i("br"),i("br"),n._v("“Đông bắc Kiếm Thần thiên, là thần bí nhất chỗ, quản lý khống chế địa phương cũng không rộng, nhưng không có phương nào thiên địa, dám đi tìm phiền toái, có truyền ngôn nói, Kiếm Lư bên trong Kiếm Thần Đại Đế, cho dù tại Cửu Đế bên trong, cũng nằm ở đỉnh phong nhất, loại trừ Tự Tại thiên vị kia, không người có thể chống lại.”"),i("br"),i("br"),n._v("“Tây nam Linh Lung thiên, ta hiện tại phần lớn thời gian, đều ở nơi đó, Linh Lung tiên tử là Cửu Đế bên trong, ta biết rõ duy nhất Nữ Đế, cùng nàng bái kiến vài lần, không có chút nào kiêu căng, làm người ta ngưỡng mộ!”"),i("br"),i("br"),n._v("“Thần giới hướng tây bắc, chính là nơi này, U Hồn thiên! U Hồn thiên Đế Quân, Càn Khôn Ma Quân, cái này không cần ta lại làm giới thiệu đi!”"),i("br"),i("br"),n._v("“Tám thiên trấn thủ tám cái phương hướng, còn ở chính giữa, là Tự Tại thiên, vị kia Đế Quân, cụ thể loại nào hình dáng, ta chưa bao giờ thấy qua, cũng chưa từng nghe qua hắn (nàng) tin đồn, thậm chí xưng hô cũng không biết được, không dám thảo luận. Chỉ biết là thực lực sâu không lường được, mặt khác tám Đế, cũng đều lấy vi tôn!”"),i("br"),i("br"),n._v("Rất nhanh, Phù Giang Thần đem Cửu Thiên Cửu Đế, giới thiệu một lần."),i("br"),i("br"),n._v("“Vân Ly Đại Đế, Phù Mãnh Đế Quân, Chước Dương Đại Đế...” Trong lòng đem chín vị Đế Quân tên ở trong lòng thì thầm một lần, triệt để ghi nhớ, Trương Huyền lúc này mới thở phào nhẹ nhõm."),i("br"),i("br"),n._v("Lạc Nhược Hi, tự xưng “Linh Thần”, cũng chính là cái gọi là Linh Nguyên chi thần, nhìn tới có thể là Bất Tử Đế Quân người thừa kế..."),i("br"),i("br"),n._v("Muốn xác định, chỉ có thể mau chóng đi Linh Nguyên thiên đi xem một chút."),i("br"),i("br"),n._v("Bất quá, Linh Nguyên thiên ở tại thần giới chính nam, mà U Hồn thiên ở tại thần giới tây bắc, khoảng cách rất xa, chỉ sợ còn cần truyền tống trận mới có thể cấp tốc đến."),i("br"),i("br"),n._v("“Nếu như Trương đan sư không có chuyện gì khác, tại hạ liền cáo từ!”"),i("br"),i("br"),n._v("Đem Cửu Thiên Cửu Đế nói xong, tại Trương Huyền hỏi thăm bên dưới, Phù Giang Thần lại nói một ít, có thể nói ra bí mật, toàn bộ giới thiệu xong, lúc này mới đứng dậy."),i("br"),i("br"),n._v("“Đa tạ Phù đan sư nói thẳng cho biết!” Trương Huyền khom người."),i("br"),i("br"),n._v("Dính dáng Cửu Đế, rất nhiều người đều không nguyện ý nói nhiều, trước mắt vị này có thể nói nhiều như vậy, đã tận tình tận nghĩa."),i("br"),i("br"),n._v("“Trương đan sư khách khí, ngươi tuổi còn trẻ liền đi đến thượng phẩm Thiên Thần cảnh giới, càng là luyện chế ra Phá Chướng đan, Mỹ Dung đan loại này nghịch thiên đan dược, đột phá Thần Vương là chuyện ván đã đóng thuyền, những tin tức này coi như ta không nói, về sau cũng biết biết. Về sau ngươi ta, khả năng tiếp xúc cũng biết càng ngày càng nhiều, việc nhỏ mà thôi, không cần phải nói!” Phù Giang Thần cười nói"),i("br"),i("br"),n._v("Tình huống bình thường, dính dáng Cửu Thiên Cửu Đế, quả thực không nhiều người nói, nhưng trước mắt vị này, bất luận thực lực, tiềm lực hay là luyện đan chi thuật, đều so với mình không kém bao nhiêu, về sau vô cùng có khả năng ngồi ngang hàng, thậm chí mạnh hơn một bậc, cùng hắn đến lúc đó lấy lòng, không bằng hiện tại kết giao."),i("br"),i("br"),n._v("Đưa than sưởi ấm trong ngày tuyết rơi, vượt xa dệt hoa trên gấm."),i("br"),i("br"),n._v("Người đăng: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-2181"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-2183"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);